import React from 'react';
import './SignUpPage.scss';

function SignUpPage() {
    return (
        <div className="sign-up-page">
            <h1 className="sign-up-title">회원가입</h1>
        <form className="sign-up-form">
            <div className="necessary-info-section">
                <div className="desc">필수 정보를 입력해주세요.</div>
                <div className="necessary-input-section">

                </div>
            </div>

            <div className="address-info-section">

            </div>

            <div className="agree-section">

            </div>

            <button type="submit" className="sign-up-btn">가입완료</button>
        </form>
        </div>
    );
}

export default SignUpPage;
